import '../style/ProjectCard.css'

function ProjectCard(props: { project: any; }) {
    const {project} = props;

    return (
        <div className="card-container">
            <h3>{project.title}</h3>
            <h4>{project.description}</h4>
            {
                Array.from(project.languages).map((language: string, index: number, value: string) => (
                    <div key={index}>
                        {project.language}
                    </div>
                ))
            }
            <div>
                {project.languages}
            </div>
        </div>
    )
}

export default ProjectCard;
